import React from 'react'

function Projects() {
  return ( 
    <section className="bg-gray-900">
      <div className="flex items-center justify-center">
        <h1 className="text-5xl font-bold text-blue">Projects</h1>
      </div>
    </section>
  )
}

export default Projects
